public class Title392 {

    public boolean isSubsequence(String s, String t) {
        if("".equals(s)){
            return true;
        }
        char[] small = s.toCharArray();
        char[] big = t.toCharArray();

        int j = 0;
        int count = 0;
        for (int i = 0; i < small.length; i++) {
            for (; j < big.length; j++) {
                //  System.out.println("small "+i+": "+small[i]+",big "+j+": "+big[j]);
                if (small[i] == big[j]) {
                    count++;
                    j++;
                    System.out.println("count: "+count);
                    break;
                }
            }
            if (count == small.length) {
                return true;
            }
        }
        return false;
    }

    public static void main(String[] args) {
        String s = "abc";
        String t = "ahbgdc";
// System.out.println("small "+i+": "+small[i]+",big "+j+": "+big[j]);
        String s2 = "axc";
        String t2 = "ahbgdc";


        String s3 = "leeeeetcode";
        String t3 = "";
        //System.out.println(new Title392().isSubsequence(s, t));

        System.out.println(new Title392().isSubsequence(s3, t3));

    }

}
